import React from 'react';

type NoteProps = {
  title: string;
  content: string;
  onDelete: () => void;
  onEdit: () => void;
};

const Note: React.FC<NoteProps> = ({ title, content, onDelete, onEdit }) => {
  return (
    <div>
      <h3>{title}</h3>
      <p>{content}</p>
      <button onClick={onEdit}>Edit</button>
      <button onClick={onDelete}>Delete</button>
    </div>
  );
};

export default Note;
